import scss from './section-solution.module.scss'
import img from "../../images/home/people.jpg";


export const SectionSolution = () => {
    return (
      <div>
        <div className={scss.imgWrapper}>
                <picture>
                    <source />
            <img src={img } alt="team" />
          </picture>
        </div>
        <div className={scss.solutions}></div>
      </div>
    );
}
